angular.module("article-detail-right-sidebar",["resource.articles","resource.comments"]).controller("ArticleDetailRightSidebarCtrl",["$scope","$routeParams","channel",function(n,t,i){return i.get().then(function(t){for(var r,i=0,u=t.length;i<u;i++)if(r=t[i],r.Name.toLowerCase()===n.item.Group.Channel.Name.toLowerCase()){n.channel=r;break}return n.group=n.item.Group})}])